    "Narrative report: Klamath Basin National Wildlife Refuges: Tule Lake, Lower Klamath,
    and Clear Lake in California, Upper Klamath and Klamath Forest in Oregon: January
    - April, 1963",nt"tracking_summary": {ntt"total": 1,ntt"recent":
    1nt},nt"groups": [],nt"relationships_as_subject": [],nt"revision_timestamp":
    "2016-07-27T22:54:27.945813",nt"name": "narrative-report-klamath-basin-national-wildlife-refuges-tule-lake-lower-klamath-and-clear-8fceb",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Tule Lake National
    Wildlife Refuge outlines Refuge accomplishments from January through April of 1963.
    The report begins by summarizing the weather conditions, habitat conditions, water
    conditions, and food and cover during this period. Wildlife- including migratory
    birds, upland game birds, big game animals, furbearers, predators, rodents, raptors,
    fish, reptiles, and disease- is also covered. The Refuge development and maintenance
    section discusses plantings and collections and receipts. Resource management is
    discussed; topics include fur harvesting. A progress report on field investigations
    and applied research is included. The public relations section of the report describes
    Refuge visitors, Refuge participation, and hunting. Items of interest, N-R forms,
    photographs, and narrative reports for Upper Klamath National Wildlife Refuge, Lower
    Klamath National Wildlife Refuge, Clear Lake, and Klamath Forest National Wildlife
    Refuge are attached.",nt"license_title": "License Not Specified",nt"extras":
